import PropTypes from 'prop-types';
import { forwardRef } from 'react';
import { Link as RouterLink } from 'react-router-dom';
// @mui
import { useTheme } from '@mui/material/styles';
import { Box, Link } from '@mui/material';

// ----------------------------------------------------------------------

const Logo = forwardRef(({ disabledLink = false, sx, ...other }, ref) => {
  const theme = useTheme();

  const PRIMARY_LIGHT = theme.palette.primary.light;

  const PRIMARY_MAIN = theme.palette.primary.main;

  const PRIMARY_DARK = theme.palette.primary.dark;

  // OR using local (public folder)
  // -------------------------------------------------------
  // const logo = (
  //   <Box
  //     component="img"
  //     src="/logo/logo_single.svg" => your path
  //     sx={{ width: 40, height: 40, cursor: 'pointer', ...sx }}
  //   />
  // );

  const logo = (
    <Box
      ref={ref}
      component="div"
      sx={{
        width: 180,
        height: 100,
        display: 'inline-flex',
        ...sx,
      }}
      {...other}
    >

<svg id="Capa_1" data-name="Capa 1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" viewBox="0 0 841.89 595.28">
      <defs>
        <style>
          {`
            .cls-1 {
              fill: #25335f;
            }

            .cls-1, .cls-2, .cls-3, .cls-4, .cls-5, .cls-6, .cls-7 {
              stroke-width: 0px;
            }

            .cls-2 {
              fill: #f9b03d;
            }

            .cls-3, .cls-8 {
              fill: none;
            }

            .cls-8 {
              stroke: #25335f;
              stroke-linecap: round;
              stroke-miterlimit: 10;
              stroke-width: 4.59px;
            }

            .cls-4 {
              fill: #223260;
            }

            .cls-9 {
              clip-path: url(#clippath);
            }

            .cls-5 {
              fill: #2dabe3;
            }

            .cls-6 {
              fill: #30358c;
            }

            .cls-7 {
              fill: #e83f44;
            }
          `}
        </style>
        <clipPath id="clippath">
          <rect className="cls-3" x="0" width="841.89" height="595.28" />
        </clipPath>
      </defs>
      <g className="cls-9">
        <rect className="cls-5" x=".17" y="187.31" width="107.26" height="26.82" />
        <rect className="cls-2" x="107.43" y="80.15" width="107.26" height="26.82" />
        <rect className="cls-6" x="80.39" y="187.2" width="27.04" height="27.04" />
        {/* Agrega el resto de tus elementos aquí */}
      </g>
      <g>
        {/* Agrega el resto de tus elementos aquí */}
      </g>
      <g>
        {/* Agrega el resto de tus elementos aquí */}
      </g>
    </svg>
        {/*<img
        src={`../../../assets/iconoRiobamba.png`} // Ruta de tu imagen
        alt="Logo"
        style={{ width: '120%', height: '60%', cursor: 'pointer'}}
    />*/}
    </Box>
  );

  if (disabledLink) {
    return <>{logo}</>;
  }

  return (
    <Link to="/" component={RouterLink} sx={{ display: 'contents' }}>
      {logo}
    </Link>
  );
});

Logo.propTypes = {
  sx: PropTypes.object,
  disabledLink: PropTypes.bool,
};

export default Logo;
